const Navbar = () =>{
    return(
        <nav className="navbar">
        <div>
          <a href="">Messages</a>
        </div>
        <div>
          <a href="">News</a>
        </div>
        <a href="">Music</a>
        <div>
          <a href="">Settings</a>
        </div>
      </nav>
    );
}

export default Navbar;
